import React from 'react';

function ReportViewer({ reportUrl }) {
  if (!reportUrl) return null;
  return (
    <div style={{ marginTop: 20, width: '100%', display: 'flex', flexDirection: 'column', gap: 12 }}>
      <h3 style={{ margin: 0 }}>Execution Report</h3>
      <div style={{ flex: 1, minHeight: '60vh', width: '100%' }}>
        <iframe
          src={reportUrl}
          title="Execution Report"
          width="100%"
          height="100%"
          style={{ border: '1px solid #ccc', borderRadius: 8, minHeight: '60vh' }}
        />
      </div>
    </div>
  );
}

export default ReportViewer;
